    def test_length_of_longest_substring(self, method_name, s, expected, timeout):
        if timeout:
            TestSolution._test_length_of_longest_substring(s, method_name, expected, timeout)
        else:
            method = getattr(self.solution, method_name)
            assert method(s) == expected

    @staticmethod
    def _run_length_of_longest_substring(solution, s, method_name, queue):
        """
        Generic wrapper for executing a method from the Solution class in a separate process.

        Args:
            solution: Solution instance
            s: Input string for the method
            method_name: Method name to execute
            queue: Multiprocessing communication queue
        """
        try:
            # Use getattr to dynamically get the method
            method = getattr(solution, method_name)
            result = method(s)
            queue.put(('success', result))
        except AttributeError:
            queue.put(('error', f"Method '{method_name}' not found in Solution class"))
        except Exception as e:
            queue.put(('error', str(e)))

    @staticmethod
    def _test_length_of_longest_substring(s, method_name, expected, timeout):
        """
        Generic timeout test method

        Args:
            s: Input string for the method
            method_name: Method name to test
            expected: Expected result
            timeout: Timeout in seconds
        """
        queue = multiprocessing.Queue()
        process = multiprocessing.Process(
            target=TestSolution._run_length_of_longest_substring,
            args=(TestSolution.solution, s, method_name, queue)
        )

        process.start()
        process.join(timeout=timeout)

        if process.is_alive():
            process.terminate()
            process.join()
            pytest.fail(f"Test exceeded {timeout} second - algorithm needs optimization!")

        if queue.empty():
            pytest.fail("Process ended without result!")

        status, result = queue.get()
        if status == 'error':
            pytest.fail(f"Error in subprocess: {result}")

        assert result == expected, f"Expected {expected}, got {result}"
